/***
 * This is a DOM touch/mouse/pointer events demo
 * This support all user-inputs (touch, mouse, stylus, etc.)
 **/

(function() {
	document.getElementById('userAgent').textContent = navigator.userAgent;

	var isActive = false;

	var canvas = document.getElementById('drawCanvas');
	var ctx = canvas.getContext('2d');
	
	// Media-queries
	if (window.matchMedia('(min-width: 420px)').matches) {
		canvas.width = 450;
		canvas.height = 450;
  	} else {
	  	canvas.width = 300;
		canvas.height = 300;
  	}
	ctx.lineWidth = '3';
	ctx.strokeStyle = document.querySelector(':checked').value;
	
	document.getElementById('colorSwatch').addEventListener('click', function() {
		ctx.strokeStyle = document.querySelector(':checked').value;
	}, false);
	
	var isTouchSupported = 'ontouchstart' in window;
	var isPointerSupported = window.PointerEvent;
	var isMSPointerSupported =  window.MSPointerEvent;
  
	var downEvent = isTouchSupported ? 'touchstart' : (isPointerSupported ? 'pointerdown' : (isMSPointerSupported ? 'MSPointerDown' : 'mousedown'));
	var moveEvent = isTouchSupported ? 'touchmove' : (isPointerSupported ? 'pointermove' : (isMSPointerSupported ? 'MSPointerMove' : 'mousemove'));
	var upEvent = isTouchSupported ? 'touchend' : (isPointerSupported ? 'pointerup' : (isMSPointerSupported ? 'MSPointerUp' : 'mouseup'));
	 
	document.getElementById('eventType').textContent = downEvent + ', ' + moveEvent + ', ' + upEvent;
	  
	canvas.addEventListener(downEvent, startDraw, false);
	canvas.addEventListener(moveEvent, draw, false);
	canvas.addEventListener(upEvent, endDraw, false);
	  
	var img = new Image();
	img.onload = function() {
	  ctx.drawImage(img, 0, 0);
	};

	function draw(e) {
	  e.preventDefault();
	  if(isActive) {
	    var x = isTouchSupported ? (e.targetTouches[0].pageX - canvas.offsetLeft) : (e.offsetX || e.layerX - canvas.offsetLeft);
	    var y = isTouchSupported ? (e.targetTouches[0].pageY - canvas.offsetTop) : (e.offsetY || e.layerY - canvas.offsetTop);
	    ctx.lineTo(x, y);
	    ctx.stroke();
	  }
	}
	
	function startDraw(e) {
	  e.preventDefault();
	  isActive = true;
	  ctx.beginPath();
	}
	
	function endDraw(e) {
	  e.preventDefault();
	  isActive = false;
	}
	
	if (window.matchMedia('(min-width: 420px)').matches) {
		img.src = 'data:image/jpeg;base64,'; 

  	} else {
  		img.src = 'data:image/jpeg;base64,'; 
  	}
	

})();